#include <nvtypes.h>


/*!

    - carter.h
    - purpose: static arrays for boundary definitions and corrections.

    - boundary arrays: purpose: replace the BOUNDARY2.DAT file with static arrays.
		                establish the carter tables boundary files as static arrays,
                                thus eliminating the external file to read.
                                note that the arrays correspond to the 181 latitudes from
                                89N to 91S ( i.e., in [89,-91) ).

    - correction arrays: purpose: replace the CORRECTN2.DAT file with static arrays.  these
                                  replicate the 85 tables defined by carter.  they should be
                                  exactly the 1st column of each table.

    - author: dave fabre, navoceano, feb 2007
    - static arrays provided below:
          - nbnd[181]        = number of lon boundaries per lat
          - lonbnd[181][43]  = lons to check against
          - area[181][43]    = areas in [1,85] matching lon
          - ncor[86]         = number of values in corrector array (1 for pad)
          - cor[86][119]     = the 85 corrector arrays of true depths (1 buff) 
          - uncdepth[]       = uncorrected depth array 200-12000m by 100m used in interpolation

    - note that there were a maxmimum of 43 lon area definition values and
      119 profile values so the arrays are padded with zeros up to
      those lengths.
    - another note:  table 53 contains the largest nominal depth of 12000
      and the largest corrected true depth of 12550.
*/


/******************************************************************************/

